import React from "react";
import Prisoner from "./Prisoner";

const PrisonOverview = props => {
  return (
    <div>
      <div>
        <h2>{props.prisonInfo.name}</h2>
      </div>

      {props.prisoners.map(p => (
        <Prisoner
          name={p.name}
          skills={p.skills}
          availability={p.availability}
          picture={p.picture}
          profile={p.profile}
        />
      ))}
    </div>
  );
};

export default PrisonOverview;
